import React, { Component } from 'react';
import Container from 'react-bootstrap/Container';
import Row from 'react-bootstrap/Row';
import Col from 'react-bootstrap/Col';

import ResidentName from '../ResidentName';
import DateOfBirth from '../ResidentDOB';
import ResidentRoom from '../ResidentRoom';
import Header from '../../../Header';
import ResidentAllergies from '../ResidentAllergies';

const ResidentName1 = ResidentName;
const DateOfBirth1 = DateOfBirth;

class CarePlan1 extends Component {
  render() {
    return (

        <div>
            <Header/>
            <h4>Resident Care Plan</h4>
            <Row>
            <Col>
            <Row>Resident</Row>
            <Row style={
                    {
                    border: '2px solid red',
                    width: "500px", minHeight: "175px",
                    paddingLeft: "0.5rem",
                    marginRight: "0.5rem",
                    align:"left"
                    }
                  }>
                  <Row style={{marginBottom: "0.5rem"}}>
                    <Col md="auto">
                    <div>
                      <ResidentName/>
                    </div>
                    </Col>
                </Row>
                <Row>
                    <Col md="auto">                    
                    <div>
                      <DateOfBirth/>
                    </div>
                    </Col>
                    <Col>
                    <div>
                      <ResidentRoom/>
                    </div>
                      </Col>
                      <Col/>
                      <Col/>
                      <Col/>
                </Row>
                </Row>
                </Col>

                <Col>
                <Row>Allergies</Row>
                <Row style={
                    {
                    border: '2px solid red',
                    width: "500px", minHeight: "175px",
                    paddingLeft: "0.5rem",
                    marginRight: "0.5rem",
                    align:"left"
                    }
                  }>
                  <Row style={{marginBottom: "0.5rem"}}>
                    <Col md="auto">
                    <div>
                      <ResidentAllergies/>
                    </div>
                    </Col>
                </Row>
                </Row>
                </Col>
                </Row>
          </div>


    );
  }
}

export default CarePlan1;
